import React from 'react';

class Weather extends React.Component {
  render() {
    return (
      <div>
        <p> Location: {this.props.city}, {this.props.country}  </p>
        {this.props.temperature}
        {this.props.humidity}
        {this.props.description}

      </div>
    );
  }
};

export default Weather;
